import React from 'react';

import { Form, Input, Button } from 'antd';
import HargaTonaseInput from './HargaTonaseInput.jsx';

const OARBeliAdd = () => {
    const onFinish = (values) => {
        for (var key of Object(values).keys) {
            if (values[key] == undefined) { values.key = 0 };
        }

        console.log('Success:', values);
    }

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    }

    // const initialValues = {
    //     cpo: 0,
    //     cpoTonnage: 0,
    //     pk: 0,
    //     pkTonnage: 0,
    //     cangkang: 0,
    //     cangkangTonnage: 0,
    //     hargabeli: 0,
    //     hargabeliTonnage: 0,
    //     supplier: 0,
    //     supplierTonnage: 0,
    //     rampluar: 0,
    //     rampluarTonnage: 0,
    //     ptpn: 0,
    //     ptpnTonnage: 0,
    //     inti: 0,
    //     intiTonnage: 0,
    //     plasma1: 0,
    //     plasma1Tonnage: 0,
    //     plasma3: 0,
    //     plasma3Tonnage: 0,
    //     hkl: 0,
    //     hklTonnage: 0,
    //     hka: 0,
    //     hkaTonnage: 0,
    //     ss: 0,
    //     ssTonnage: 0,
    //     kosolah: 0
    // }

    return (
        <Form
            name="oarbeli_form"
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
            labelCol={{ span: 4 }}
        >
            <HargaTonaseInput
                label="CPO"
                fieldName="cpo"
            />

            <HargaTonaseInput
                label="PK"
                fieldName="pk"
            />

            <HargaTonaseInput
                label="Cangkang"
                fieldName="cangkang"
            />

            <HargaTonaseInput
                label="Harga beli"
                fieldName="hargabeli"
            />

            <HargaTonaseInput
                label="Supplier"
                fieldName="supplier"
            />
            <HargaTonaseInput
                label="Ramp luar"
                fieldName="rampluar"
            />

            <HargaTonaseInput
                label="PTPN"
                fieldName="ptpn"
            />

            <HargaTonaseInput
                label="Inti"
                fieldName="inti"
            />

            <HargaTonaseInput
                label="Plasma 1"
                fieldName="plasma1"
            />

            <HargaTonaseInput
                label="Plasma 3"
                fieldName="plasma3"
            />
            <HargaTonaseInput
                label="HKL"
                fieldName="hkl"
            />

            <HargaTonaseInput
                label="HKA"
                fieldName="hka"
            />
            <HargaTonaseInput
                label="SS"
                fieldName="ss"
            />

            <Form.Item
                label="Kos Olah"
                name="kosolah">
                <Input
                    type="number"
                    suffix="Rp/kg"
                />

            </Form.Item>
            <Form.Item>
                <Button type="primary" htmlType="submit" style={{float: 'right'}}>
                    Submit
                </Button>
            </Form.Item>
        </Form>
    );
};

export default OARBeliAdd;
